const Canvas = (props) => (
  <canvas id="canvas" width="200" height="200" onload="draw()"></canvas>
);

const draw = () => {
  let ctx = canvas.getContext('2d');
  ctx.fillStyle = 'rgb(200, 0, 0)';
  ctx.fillRect(10, 10, 50, 50);
};

export default Canvas;
